  false,\n\t\"url\": null,\n\t\"notes\": \"The NOAA Hypoxia Watch project provides
  near-real-time, web-based maps of dissolved oxygen near the sea floor over the Texas-Louisiana
  continental shelf during a period that extends from early June to mid-July. For
  2008, the Hypoxia Watch also had a fall component as dissolved oxygen was sampled
  during an October and November cruise. The NOAA National Marine Fisheries Service
  Mississippi Laboratories at Pascagoula and Stennis Space Center and the NOAA National
  Coastal Data Development Center (NCDDC) at Stennis Space Center began the Hypoxia
  Watch project in 2001. Scientists aboard the NOAA Research Vessel Oregon II measure
  seawater properties, such as water temperature, salinity, chlorophyll, and dissolved
  oxygen at each of approximately 240 locations as the Oregon II cruises the waters
  south of Pascagoula, MS and then makes its way from Brownsville, Texas, to the mouth
  of the Mississippi River. A scientist aboard the ship processes the measurements
  from electronic dissolved oxygen sensors, checks the measurements periodically with
  chemical analyses of the seawater, then sends the data by e-mail to NCDDC at Stennis
  Space Center approximately every three to five days. Physical Scientists at NCDDC
  transform the dissolved oxygen measurements into contour maps, which identify areas
  of low oxygen, or hypoxia. During the 6-week cruise, as the data is received from
  the ship, NCDDC generates new maps and immediately publishes them on the web. Maps
  will be published every three to five days from approximately Oct. 14 to Nov. 22.\",\n\t\"license_title\":
